import styled from 'styled-components'
import { motion } from 'framer-motion';

export const Main = styled.main`
 .first{
    background: white;
 }
`;


export const Section = styled.div`
    position: relative;
`;


export const Sticky = styled.div`

/* faz ele ocupar toda a tela eficar parado para não parecer que esta escrolando */
height: 100vh;
position: sticky;
top:0;
left:0;
right:0;

`;
